import React, { useState } from 'react';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TableSortLabel,
  Paper,
  TablePagination,
  Collapse,
  IconButton,
  Box
} from '@mui/material';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';
import { getColumns } from './columns';
import { trackUserInteraction } from '../../utils/analytics';
import ExpandedRow from './ExpandedRow';

const Row = ({ pair, columns }) => {
  const [open, setOpen] = useState(false);

  const handleRowClick = () => {
    setOpen(!open);
    trackUserInteraction.pairClick(pair.pairName);
  };

  return (
    <>
      <TableRow
        hover
        sx={{
          cursor: 'pointer',
          transition: 'all 0.2s',
          backgroundColor: pair.is_blacklisted ? 'error.lighter' : 'background.paper',
          '&:hover': {
            backgroundColor: pair.is_blacklisted ? 'error.light' : 'action.hover',
            transform: 'translateY(-1px)',
            boxShadow: 1
          },
          '& > td': {
            borderBottom: 1,
            borderColor: 'divider',
            py: 2
          }
        }}
        onClick={handleRowClick}
      >
        <TableCell>
          <IconButton
            size="small"
            sx={{
              transition: 'transform 0.2s',
              transform: open ? 'rotate(-180deg)' : 'rotate(0)',
              color: 'primary.main'
            }}
          >
            <KeyboardArrowDownIcon />
          </IconButton>
        </TableCell>
        {columns.map((column) => (
          <TableCell
            key={column.id}
            align={column.numeric ? 'right' : 'left'}
            sx={{
              color: column.highlight ? 'primary.main' : 'text.primary',
              fontWeight: column.highlight ? 500 : 400
            }}
          >
            {column.render ? column.render(pair) : pair[column.id]}
          </TableCell>
        ))}
      </TableRow>
      <TableRow>
        <TableCell 
          colSpan={columns.length + 1} 
          sx={{ 
            p: 0,
            border: 0,
            bgcolor: 'background.default'
          }}
        >
          <Collapse in={open} timeout="auto" unmountOnExit>
            <Box sx={{ py: 2 }}>
              <ExpandedRow pair={pair} />
            </Box>
          </Collapse>
        </TableCell>
      </TableRow>
    </>
  );
};

const PairsTable = ({
  pairs,
  orderBy,
  order,
  page,
  rowsPerPage,
  handleSort,
  handleChangePage,
  handleChangeRowsPerPage,
  totalCount
}) => {
  const columns = getColumns();

  return (
    <TableContainer 
      component={Paper} 
      sx={{ 
        boxShadow: 2,
        borderRadius: 2,
        '& .MuiTable-root': {
          borderCollapse: 'separate',
          borderSpacing: '0 4px'
        }
      }}
    >
      <Table aria-label="pairs table">
        <TableHead>
          <TableRow
            sx={{
              '& th': {
                fontWeight: 600,
                backgroundColor: 'background.paper',
                borderBottom: 2,
                borderColor: 'divider',
                py: 2
              }
            }}
          >
            <TableCell width="48px" /> {/* Expand icon column */}
            {columns.map((column) => (
              <TableCell
                key={column.id}
                align={column.numeric ? 'right' : 'left'}
                sortDirection={orderBy === column.id ? order : false}
                sx={{
                  cursor: 'pointer',
                  '&:hover': {
                    backgroundColor: 'action.hover'
                  }
                }}
                onClick={() => handleSort(column.id)}
              >
                <TableSortLabel
                  active={orderBy === column.id}
                  direction={orderBy === column.id ? order : 'asc'}
                >
                  {column.label}
                </TableSortLabel>
              </TableCell>
            ))}
          </TableRow>
        </TableHead>
        <TableBody>
          {pairs.map((pair) => (
            <Row 
              key={pair.address} 
              pair={pair} 
              columns={columns}
            />
          ))}
        </TableBody>
      </Table>
      <TablePagination
        rowsPerPageOptions={[10, 25, 50, 100]}
        component="div"
        count={totalCount}
        rowsPerPage={rowsPerPage}
        page={page}
        onPageChange={handleChangePage}
        onRowsPerPageChange={handleChangeRowsPerPage}
        sx={{
          borderTop: 1,
          borderColor: 'divider',
          bgcolor: 'background.paper'
        }}
      />
    </TableContainer>
  );
};

export default PairsTable;
